INSERT INTO `posts` VALUES (4,'لورم ایپسوم متن ساختگی با تولید سادگی نام','لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است.','<p style=\"text-align:right\">لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>','http://app.nobaarapp.ir//images/post/1549112980.png',NULL,'مدیر سایت',1,'2019-02-02 13:09:40','2019-02-02 13:09:40'),(5,'لورم ایپسوم متن ساختگی با تولید سادگی نام','لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است.','<p style=\"text-align:right\">لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>','http://app.nobaarapp.ir//images/post/1549113026.png',NULL,'مدیر سایت',1,'2019-02-02 13:10:26','2019-02-02 13:10:26'),(6,'فهوم از صنعت چاپ','فهوم از صنعت چاپ و با استفاده از طراحان گرافیک است.','<p style=\"text-align:center\">فهوم از صنعت چاپ و با استفاده از طراحان گرافیک است.</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\">لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ و با استفاده از طراحان گرافیک است. چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است و برای شرایط فعلی تکنولوژی مورد نیاز و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد. کتابهای زیادی در شصت و سه درصد گذشته، حال و آینده شناخت فراوان جامعه و متخصصان را می طلبد تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی و فرهنگ پیشرو در زبان فارسی ایجاد کرد. در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها و شرایط سخت تایپ به پایان رسد وزمان مورد نیاز شامل حروفچینی دستاوردهای اصلی و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>','http://app.nobaarapp.ir//images/post/1549113264.jpg',NULL,'مدیر سایت',1,'2019-02-02 13:14:24','2019-02-02 13:14:24'),(8,'غولی به نام اسباب کشی','اسباب کشی از اون کارهای خیلی سخته،مقاله ما شاید بتونه کمکتون کنه','<p dir=\"RTL\">اسباب کشی از اون موضوعاتی هستش که حتی فکر کردن بهش هم تن آدم رو به لرزه درمیاره. شاید به همین دلیل باشه که بین انگلیسی ها یه ضرب المثل رایج هست که میگن فقط سه بار اسباب کشی به اندازه یه آتیش سوزی مهیب به خونه آدم لطمه میزنه! همه ما روزهای منتهی به اسباب کشی در روشهای سنتی رو به یاد داریم,معمولا یک شب قبل از این دردسر بزرگ به دوستان و اقوام زنگ میزدیم و طلب کمک میکردیم.البته خیلی از اوقات با جوابهای منفی روبرو میشدیم و در نهایت هم با کلی دردسر خودمون با اندک نیروی خانواده و با کلی مشقت این غول رو ضربه فنی میکردیم.البته توی همچین موقعیت هایی معمولا خیلی از وسایل آسیب و صدمه میدید و با کلی عذاب وجدان خودمون رو سرزنش میکردیماما آیا امروزه هم ما مجبور به انجام چنین ریسکی هستیم؟ آیا راههای بهتری هم هست؟ جواب مثبت هستش! در ادامه این مقاله تغییراتی که در زمینه حمل و نقل و اسباب کشی رخ داده رو باهم مرور میکنیم.</p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\">اسباب کشی اسان هم مگه داریم!!</p>\r\n\r\n<p dir=\"rtl\">بله ! شما هم میتونید یه اسباب کشی آسان رو تجربه کنین. اگه قصد دارین به روش سنتی عمل کنین بهتر این هستش که سایرین رو هم در این کار مشارکت بدین بخصوص اونهایی که تنومند تر و البته با دقت تر عمل میکننبه بچه ها اجازه بدین خودشون وسایل رو در جعبه های کوچیک جاسازی کنن البته بعد از یک راهنمایی مختصر و اینکه بهشون یاد بدین روی جعبه و کارتن وسایلشون حتما اسامی وسایل و محتویات رو بنویسن. صحبت از جعبه های کوچیک شد.برای اینکه مجبور نباشین زحمت کشیدن و حمل جعبه های بزرگ و سنگین رو به جون بخرین بهتره وسایل رو توی جعبه های کوچیک تر قرار بدین.با اینکار احتمال صدمات رو خیلی پایین میارین . فراموش نکنین برای اینکار هیچ عجله ای به خرج ندین.راحت روی صندلی بشینین و با دقت وسایل رو توی جعبه ها دسته بندی کنین.به همین راحتی.البته اگه حوصله,وقت,توان و افراد کافیرو برای اینکار ندارین میتونین از راههای دیگه ای هم استفاده کنین. راههایی که به معنای واقعی باعث به وجود اومدن یه اسباب کشی آسان برای شما میشه.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">بهتره&nbsp;هنگام بسته بندی وسایل این موارد رو مد نظر داشته باشین:</p>\r\n\r\n<ul dir=\"rtl\">\r\n	<li><strong>برای اینکه کارتن هاتون باز نشه بهتره ته این جعبه هارو با چسب محکم کنین. برای اینکه کارتون رو محکمتر کنین بهتره از مقوا و روزنامه باطله ته کارتنها استفاده کنین. حتی میتونین وسایل رو روزنامه پیچ کنین به این صورت احتمال صدمه رو خیلی پایین میارین. در انتها هم بهتره روی کارتنها اسامی وسایل و محتویات رو بزنید تا در موقع باز کردن وسایل بدونین هر وسیله ای کجا هستش.</strong></li>\r\n	<li><strong>سعی کنین وسایل رو دسته بندی کنین و مشابه ها رو باهم در کارتن ها جاسازی کنین.</strong></li>\r\n	<li><strong>از لباس و حوله و لباسهای دیگه برای فیکس کردن و محکم کردن وسایل درون کارت ها استفاده کنین.با این کار دو نشون رو میزنین هم فضاهای خالی رو با لباسها پر میکنین و هم یک نوع ضربه گیر خوب برای وسایل درست میکنن.</strong></li>\r\n	<li><strong>بعد از اتمام کار حتما محتویات کارتن ها رو بنویسین و قید کنین هر کارتن مربوط به چه شخصی هستش.</strong></li>\r\n	<li><strong>حتی میتونین با ماژیک یک فلش روی جعبه بکشید و قسمتی که باید از اون جهت باز بشه رو مشخص کنین.</strong></li>\r\n	<li><strong>برای لباسهاتون کارتنهای مخصوص در نظر بگیرین.&nbsp;این جعبه ها معمولا دارای اویز هستن و باعث میشن لباسهاتون در زمان جابه جایی چروک نشن.با اینکار دیگه نیازی به اتوی مجدد در بعد از خارج کردن لباسها از جعبه ها ندارین.شما حتی می&zwnj;تونین لباسها رو بر اساس ضخامت یا فصل یا رنگ اونهادسته بندی کنین و سرجای خودشون قرار بدین. با این کار به محض ورود به خونه جدید میتونین اونها رو سریعا به کمدها انتقال بدین. آیا لذت بخش نیست؟</strong></li>\r\n	<li><strong>سعی کنین وسایل بزرگ رو در کارتن های بزرگ و وسایل کوچیک رو توی کارتن های کوچیک قرار بدین.با این توضیح که احتمال شکسته شدن وسایل کوچیک در جعبه ها و کارتنهای بزرگ خیلی زیادتر هستش. البته کتابها از این قانون مستثنی هستن و میشه اونها رو در هر جعبه ای قرار داد چون جز وسایل شکستنی نیستن.</strong></li>\r\n	<li><strong>سعی کنین وسایل سنگین تر رو کف جعبه و کارتن ها قرار بدین و وسایل سبک تر رو بالاتر از وسایل سنگین جای گذاری کنین.</strong></li>\r\n	<li><strong>هیچوقت در هنگام حمل و نقل به جعبه های پر فشار نیارید چون باعث میشه وسایل و محتویات جعبه شکسته و بهشون آسیب برسه.</strong></li>\r\n	<li><strong>&nbsp;در خصوص حمل و نقل درایورها بهتر این هستش که وسایل درون درایورها بمونن و جابه جا نشن.فقط کافیه درایورها با چسب به کمد محکم فیکس بشه. در زمانی که در دسترسی به جعبه و کارتن ندارین استفاده از درایورها بهترین راه حل هستش، البته اگر داخل درایورها وسایل شکستنی نیست بگذارین همونجا بمونن.بازهم تاکید میشه حتما در این وضعیت با نوار چسب درایورها رو محکم به بدنه کمد فیکس کنین.</strong></li>\r\n	<li><strong>باید دقت کنین درایورها رنگ شده نباشن چون نوار چسب باعث صدمه به رنگ درایورها میشه.</strong></li>\r\n	<li><strong>در حمل بشقابها اونها رو در نزدیکی لبه کارتن و جعبه ها جای گذاری کنین.</strong></li>\r\n	<li><strong>خیلی ها به اشتباه بشقابها رو در ته کارتن و جعبه قرار میدن. اما اگر آن&zwnj;ها را نزدیک لبه قرار دهیداما اگر در لبه کارتن جای گذاری بشن احتمال شکسته شدن پایین میاد البته حتما از روزنامه برای نگه داری بشقابها استفاده کنین.در این وضعیت بهمراه بشقابها وسایل دیگه ای قرار ندین چون حتما باعث شکسته شدن اونها میشه.</strong></li>\r\n	<li><strong>هنگام بسته بندی ظروف شیشه ای و بلور سنگین تر ها رو ته و اونهایی رو که ظریف تر و شکستنی تر هستن رو قرار بدین.با این کار هنگام تخلیه زودتر به ظروف شکستنی دسترسی دارین و این کار باعث حفاظت از این ظروف میشه.</strong></li>\r\n</ul>\r\n\r\n<p dir=\"RTL\"><br />\r\n&nbsp;</p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><br />\r\n<strong>&nbsp;اسباب کشی ارزان! کجا میشه پیداش کرد؟</strong></p>\r\n\r\n<p dir=\"RTL\">امروزه با روشهای جدیدی که در حمل و نقل افراد و وسایل به وجود اومده خدماتی بسیار متنوع و زیادی در این بخش به مردم ارائه میشه<strong>.&nbsp;</strong>انبوهی از شرکت ها و موسسات وجود دارن که در این خصوص خدمات ارائه میدن و به معنای واقعی اسباب کشی ارزان رو به مشتریهاشون ارائه میدن. این موسسات از صفر تا صد داستان اسباب کشی رو به عهده میگیرن و با استفاده از نیروی زبده در این خصوص باعث میشن مردم هیچ دغدغه ای بابت حمل و نقل وسایل و اسباب کشی نداشته باشن.اونهم با هزینه های پایینو ناچیز! ما میتونیم &nbsp;با شرکتهای باربری آنلاین که&nbsp;کار اسباب کشی انلاین&nbsp;&nbsp;انجام میدن تماس برقرار کنیم و به راحتی و در سریعترین زمان کار حمل وسایل رو به اونها بسپریم.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>اسباب کشی آنلاین</strong></p>\r\n\r\n<p dir=\"RTL\">همونطور که گفتیم برای داشتن یه تجربه آسان اسباب کشی یکی از بهترین کارها استفاده از موسسات حمل نقل هستش. برای مثال همه ما با حمل و نقل افراد و شرکتهای تاکسی آنلاین آشنایی داریم. نحوه کار این شرکتها به اینصورت هستش که کار باربری آنلاین رو انجام میدن.یعنی شما با استفاده از اپلیکیشن اسباب کشی این شرکتها به راحتی سفارشتون رو ثبت میکنین و این شرکتها در سریعترین زمان به منزل شما مراجعه میکنن و کار اسباب کشی و حمل و نقل وسایل شما رو به عهده میگیرن. با&nbsp; بهره بردن از اپلیکیشن اسباب کشی تنها کار شما فقط ثبت درخواست هستش.یعنی میتونی لذت یه اسباب کشی بی دردرسر رو بدون کمترین زحمت تجربه کنین.</p>','http://app.nobaarapp.ir//images/post/1549294436.jpg','http://app.nobaarapp.ir//images/post/1549294436.jpg','تیم تولید محتوا نوبار',1,'2019-02-04 15:33:56','2019-02-04 15:33:56');
